        private static readonly ConcurrentDictionary<string, TicketingAttachmentValue> _values =
            new ConcurrentDictionary<string, TicketingAttachmentValue>(_knownValues);

        private TicketingAttachmentValue(string value)
        {
            if (value == null) throw new ArgumentNullException(nameof(value));
            Value = value;
        }

        public string Value { get; }

        public static TicketingAttachmentValue Of(string value)
        {
            return _values.GetOrAdd(value, _ => new TicketingAttachmentValue(value));
        }

        public static implicit operator TicketingAttachmentValue(string value) => Of(value);
        public static implicit operator string(TicketingAttachmentValue ticketingattachmentvalue) => ticketingattachmentvalue.Value;

        public static TicketingAttachmentValue[] Values()
        {
            return _values.Values.ToArray();
        }

        public override string ToString() => Value.ToString();

        public bool IsKnown()
        {
            return _knownValues.ContainsKey(Value);
        }

        public override bool Equals(object? obj) => Equals(obj as TicketingAttachmentValue);

        public bool Equals(TicketingAttachmentValue? other)
        {
            if (ReferenceEquals(this, other)) return true;
            if (other is null) return false;
            return string.Equals(Value, other.Value);
        }

        public override int GetHashCode() => Value.GetHashCode();
    }

